const events = {
  redirect(url) {
    if (url) {
      window.location.href = url;
    }
  },

  alert(msg) {
    if (msg) {
      alert(msg);
    }
  },
};

const mixins = {
  methods: events,
};

const eventList = [
  {
    key: 'redirect',
    label: '\u8DF3\u8F6C\u4E8B\u4EF6',
    event: events.redirect,
    param: '',
  },
  {
    key: 'alert',
    label: 'alert \u4E8B\u4EF6',
    event: events.alert,
    param: '',
  },
];

export { mixins, events, eventList };
